namespace RonSijm.FluidHumidifier.Factories.Lambda;

public class EventSourceMappingFactory(string resourceName = null, Action<Humidifier.Lambda.EventSourceMapping> factoryAction = null) : ResourceFactory<Humidifier.Lambda.EventSourceMapping>(resourceName)
{

    internal List<InnerEventSourceMappingSourceAccessConfigurationFactory> SourceAccessConfigurationsFactories { get; set; } = [];

    internal InnerEventSourceMappingSelfManagedEventSourceFactory SelfManagedEventSourceFactory { get; set; }

    internal InnerEventSourceMappingFilterCriteriaFactory FilterCriteriaFactory { get; set; }

    internal InnerEventSourceMappingDestinationConfigFactory DestinationConfigFactory { get; set; }

    internal InnerEventSourceMappingAmazonManagedKafkaEventSourceConfigFactory AmazonManagedKafkaEventSourceConfigFactory { get; set; }

    internal InnerEventSourceMappingScalingConfigFactory ScalingConfigFactory { get; set; }

    internal InnerEventSourceMappingSelfManagedKafkaEventSourceConfigFactory SelfManagedKafkaEventSourceConfigFactory { get; set; }

    internal InnerEventSourceMappingDocumentDBEventSourceConfigFactory DocumentDBEventSourceConfigFactory { get; set; }

    protected override Humidifier.Lambda.EventSourceMapping Create()
    {
        var eventSourceMappingResult = CreateEventSourceMapping();
        factoryAction?.Invoke(eventSourceMappingResult);

        return eventSourceMappingResult;
    }

    private Humidifier.Lambda.EventSourceMapping CreateEventSourceMapping()
    {
        var eventSourceMappingResult = new Humidifier.Lambda.EventSourceMapping
        {
            GivenName = InputResourceName,
        };

        return eventSourceMappingResult;
    }
    public override void CreateChildren(Humidifier.Lambda.EventSourceMapping result)
    {
        base.CreateChildren(result);

        result.SourceAccessConfigurations = SourceAccessConfigurationsFactories.Any() ? SourceAccessConfigurationsFactories.Select(x => x.Build()).ToList() : null;
        result.SelfManagedEventSource ??= SelfManagedEventSourceFactory?.Build();
        result.FilterCriteria ??= FilterCriteriaFactory?.Build();
        result.DestinationConfig ??= DestinationConfigFactory?.Build();
        result.AmazonManagedKafkaEventSourceConfig ??= AmazonManagedKafkaEventSourceConfigFactory?.Build();
        result.ScalingConfig ??= ScalingConfigFactory?.Build();
        result.SelfManagedKafkaEventSourceConfig ??= SelfManagedKafkaEventSourceConfigFactory?.Build();
        result.DocumentDBEventSourceConfig ??= DocumentDBEventSourceConfigFactory?.Build();
    }

} // End Of Class

